import dummyData from "../dummyData";
import { useState } from "react";
import FilmElement from "./FilmElement";

export default function UpcomingList() {
  const [filmList, setFilmList] = useState([]);

  const filmElement = dummyData.map((film, index) => {
    return <FilmElement title={film.title} poster={film.poster} />;
  });

  return (
    <div className="section">
      <h1 className="title">Upcoming Films</h1>
      <div className="filmList">{filmElement}</div>
    </div>
  );
}
